window.bookSummaryJSON = "<p><i>A charming ladies' man that everybody loves.</i></p> <p><i>A badass photojournalist that treats every day as a new adventure.</i></p> <p><i>A friends with benefits relationship.</i></p> <p>When Aiden and Dani meet on his college campus, their playful banter and physical chemistry immediately draw them to each other. It's easy for one accidental meet-cute to become a standing date, and for a certain understanding to develop between them. Because neither one of them has any interest in anything serious.</p> <p>Over time, their physical relationship blossoms into an actual friendship. Before long, they're texting for no reason, meeting each other's friends, and spending nights together that don't end between the sheets. But the closer they get, the more both of their apprehension toward relationships becomes an obstacle between them.</p> <p>While Aiden struggles to balance his feelings for Dani with his long-term fear of abandonment, Dani is forced to reexamine her past and her reasons for not wanting to get close to anyone.</p> <p>Will Aiden and Dani be able to get past their relationship fears and let themselves fall in love? Or will their mistrust of love keep them from their happy ending?</p> <p><b><i>***3 Count is the third novel in the Fight Game series but can be listened to as a standalone. It is a friends with benefits to lovers sports romance featuring strong language and explicit sexual scenes. Listener discretion is advised!</i></b></p> <p><b><i>©2024 Nikki Castle (P)2024 Audio Sorceress©2022 Nikki Castle (P)2024 Nikki Castle</i></b></p>"; 
